import Decoration from '../Composants/Decoration'
import Menu from '../Composants/Menu'
import {Link} from 'react-router-dom'
import '../CSS/style.css'
import '../CSS/animation.css'

function Choix(){
    return(
        <div class="choixAcceder">
            <Link to="/inscription"><button class="btn-inscrire">Mon Identité</button></Link>
            <Link to="/ToutesIdentites"><button class="btn-acceder">Autre identité</button></Link>
            <Link to="/choixMenu"><button class="btn-acceder">Retour</button></Link>
        </div>
    )
}

function Acceder(){
    return (
    <div class="super-container">
        <section class="container">
            <Menu/>
            <div class="container-formulaire">
                <Decoration/>
                
                <Choix/>
            </div>
        </section>
    </div>
    )
}
export default Acceder;
